// AboutUs.js

import React from "react";
import "../style.css";

const AboutUs = () => {
  return (
    <div>
      <h1>About Us</h1>
      <p>
        Helping Hands is an organization started in 2024 with the aim of
        simplifying people's lives by providing the necessary services available
        when required.
      </p>
    </div>
  );
};

export default AboutUs;
